import React from 'react';
import "../css/Home.css"


const Home = () => {
  return (
    <div className="home-container">
    <div className="col-lg-7 offset-lg-1">
        <div className="h1">
            안녕하세요,<br/> 어쩌고저쩌고
        </div>
        <button className="home-container-button btn btn-outline-light">
            Project
        </button>
        <button className="home-container-button btn btn-outline-light">
            Contact
        </button>
    </div>
</div>
  );
};

export default Home;
